import React from "react";
import MainCom from "./MainCom";

const Contact = () =>{
    return(
        <section className="contact">
        <MainCom 
            heading="Contact Us"
        />
        <div className="container">
            <div className="row contact_row">
                <div className="col-lg-5 col-md-12 contact_1">
                    <h3>Contact Info</h3>
                    <p>We're here to assist you. Please don't hesitate to get in touch with us if you have any questions, comments, or feedback. You can reach us through the following contact methods:</p>
                    <ul type="none">
                        <li><a href="tel:+923004009110"><i class="fa-solid fa-square-phone"></i></a></li>
                    </ul>

                </div>
            </div>
        </div>
        

        </section>
    )
}

export default Contact;
